import { NavWrapper, Logo } from "utils/GlobalStyles";
import LogoImg from '../utils/assets/logoimage.png';
import { HamburgerMenu } from "./HamburgerMenu";

export const Navbar = () => {

    return (
      <>
           <Logo src={LogoImg} alt="langish logo" />
          <HamburgerMenu />
          </>
    )
}
